const { default: axios } = require('axios');

const API = axios.create({
	baseURL: 'https://dev.seojin.shop/web/users/email',
	timeout: 10000,
	headers: {
		'Content-Type': `application/json;charset=UTF-8`,
		'Access-Control-Allow-Origin': '*',
		Accept: 'application/json',
	},
});

export default API;
